import * as THREE from 'three';
import { GLTFLoader } from 'three/addons/loaders/GLTFLoader.js';

// Função que retorna uma Promise com o modelo carregado
export function loadRobotModel() {
    return new Promise((resolve, reject) => {
        
        // ========= COLE SUA STRING BASE64 AQUI =========
        // 1. Apague a linha abaixo ("PASTE_YOUR_BASE64_STRING_HERE";)
        // 2. Cole a string gigante que você copiou do Base64 Guru.
        const base64String = "";
        // ===============================================

        // O GLTFLoader precisa da string formatada como uma "Data URL".
        const dataUrl = `data:application/octet-stream;base64,${base64String}`;

        const loader = new GLTFLoader();
        
        loader.load(
            dataUrl,
            (gltf) => {
                resolve(gltf); // Resolve a Promise com o GLTF carregado
            },
            undefined,
            (error) => {
                console.error("Erro ao carregar modelo a partir de string Base64:", error);
                reject(error); // Rejeita em caso de erro
            }
        );
    });
}
